import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import LandingPage from "./pages/LandingPage";
import LoginPageAdmin from "./pages/LoginPageAdmin"; 
import LoginPageChimiste from "./pages/LoginPageChimiste";
import LoginPagePharma from "./pages/LoginPagePharma";
import LoginPageDev from "./pages/LoginPageDev";
import PrivateRoute from "./components/PrivateRoute";
import Dashboard from "./pages/Dashboards/Dashboard";
import Footer from './components/Footer';
import About from './components/About';

const App = () => {
  return (
    <Router>
      {/* Affichage global de About (peut être déplacé dans LandingPage sinon) */}
      <About />

      <Routes>
        <Route path="/" element={<LandingPage />} />
        <Route path="/login/admin" element={<LoginPageAdmin />} />
        <Route path="/login/chimiste" element={<LoginPageChimiste />} />
        <Route path="/login/pharma" element={<LoginPagePharma />} />
        <Route path="/login/dev" element={<LoginPageDev />} />
        <Route
          path="/dashboard"
          element={
            <PrivateRoute allowedRoles={["admin", "chimiste", "pharma", "dev"]}>
              <Dashboard />
            </PrivateRoute>
          }
        />
        <Route path="/unauthorized" element={<h1>Accès non autorisé</h1>} />
        <Route path="*" element={<h1>Page Non Trouvée</h1>} />
      </Routes>

      {/* Affichage global du footer */}
      <Footer />
    </Router>
  );
};

export default App;
